INSERT INTO `media` (`id`, `title`, `summary`, `notes`, `poster`, `created_at`, `updated_at`, `media_type`) VALUES
	(1, 'Alien Resurrection', 'Two centuries after her death, Ellen Ripley is revived as a powerful human/alien hybrid clone who must continue her war against the aliens.', NULL, 'alien-resurrection.jpg', '2017-09-10 08:56:03', '2017-09-10 08:56:03', 'movie'),
	(2, 'Alien', 'After a space merchant vessel perceives an unknown transmission as a distress call, its landing on the source moon finds one of the crew attacked by a mysterious life-form, and they soon realize that its life cycle has merely begun.', NULL, 'alien.jpg', '2017-09-10 09:14:47', '2017-09-10 09:14:47', 'movie'),
	(3, 'Aliens', 'After floating in space for 57 years, Lt. Ripley\'s shuttle is found by a deep space salvage team. Upon arriving at LV-426, the marines find only one survivor, a nine year old girl named Newt. But even these battle-hardened marines with all the latest weaponry are no match for the hundreds of aliens that have invaded the colony.', NULL, 'aliens.jpg', '2017-09-10 09:56:12', '2017-09-10 09:56:12', 'movie'),
	(4, 'Chronicle', 'Whilst attending a party, three high school friends gain superpowers after making an incredible discovery underground. Soon, though, they find their lives spinning out of control and their bond tested as they embrace their darker sides.', NULL, 'chronicle.jpg', '2017-09-10 10:01:20', '2017-09-10 10:01:20', 'movie'),
	(5, 'Dave Chappelle: For What It\'s Worth', 'Chappelle cuts loose in what he does best, Chappelle-style! And for what it\'s worth, no one is safe from Dave!', NULL, 'for-what-it\'s-worth.jpg', '2017-09-10 10:08:06', '2017-09-10 10:08:06', 'movie'),
	(6, 'Deadpool', 'A fast-talking mercenary with a morbid sense of humor is subjected to a rogue experiment that leaves him with accelerated healing powers and a quest for revenge.', NULL, 'deadpool.jpg', '2017-09-10 10:55:41', '2017-09-10 10:55:41', 'movie'),
	(7, 'Donald Glover: Weirdo', 'With his unique brand of youthful storytelling Donald Glover brings down the house in his hysterical stand-up special Weirdo.', NULL, 'weirdo.jpg', '2017-09-10 10:58:19', '2017-09-10 10:58:19', 'movie'),
	(8, 'Edge of Tomorrow', 'A soldier fighting aliens gets to relive the same day over and over again, the day restarting every time he dies.', NULL, 'edge-of-tomorrow.jpg', '2017-09-10 11:00:31', '2017-09-10 11:00:31', 'movie'),
	(9, 'Feeding Frenzy', 'A tongue-in-cheek homage to the rubber puppet monster movies of the 1980\'s like Critters and Gremlins.', NULL, 'feeding-frenzy.jpg', '2017-09-10 11:04:05', '2017-09-10 11:04:05', 'movie'),
	(10, 'Fright Night Part 2', 'Charley Brewster and Peter Vincent must face more vampires which are out for revenge.', NULL, 'fright-night-part-2.jpg', '2017-09-10 11:08:56', '2017-09-10 11:08:56', 'movie'),
	(11, 'Ghost in the Shell', 'In the near future, Major is the first of her kind: A human saved from a terrible crash, who is cyber-enhanced to be a perfect soldier devoted to stopping the world\'s most dangerous criminals.', NULL, 'ghost-in-the-shell.jpg', '2017-09-10 11:11:19', '2017-09-10 11:11:19', 'movie'),
	(12, 'Ghostbusters', 'Three former parapsychology professors set up shop as a unique ghost removal service.', NULL, 'ghostbusters.jpg', '2017-09-10 11:13:38', '2017-09-10 11:13:38', 'movie'),
	(13, 'Gorilla Interrupted', 'Four misfits band together to save the world from an alien invasion. Schlock ensues.', NULL, 'gorilla-interrupted.jpg', '2017-09-10 11:15:53', '2017-09-10 11:15:53', 'movie'),
	(14, 'Green Lantern', 'Reckless test pilot Hal Jordan is granted an alien ring that bestows him with otherworldly powers that inducts him into an intergalactic police force, the Green Lantern Corps.', NULL, 'green-lantern.jpg', '2017-09-10 11:17:26', '2017-09-10 11:17:26', 'movie'),
	(15, 'Guardians of the Galaxy Vol. 2', 'The Guardians must fight to keep their newfound family together as they unravel the mystery of Peter Quill\'s true parentage.', NULL, 'guardians-of-the-galaxy-vol-2.jpg', '2017-09-10 11:19:49', '2017-09-10 11:19:49', 'movie'),
	(16, 'Guyver: Dark Hero', 'Sean Barker became the unwilling host to an alien bio-armor known as the Guyver. A year ago he destroyed the Kronos Corporation, an organization of mutants who want the Guyver. Now he is trying to find why the Guyver unit forces him to fight and kill evil. He is lead to an archelogical site where scientists discover an ancient space craft. Now he must fight Kronos again before they discover the secrets of the Guyver\'s origin.', NULL, 'guyver-dark-hero.jpg', '2017-09-10 11:22:11', '2017-09-10 11:22:11', 'movie'),
	(17, 'How Not to Make a Movie', 'Both entertaining and educational, "How Not to Make a Movie" chronicles how the Red Letter Media guys all met and started making movies together, which lead to the disasterous production of the 2003 feature film collaboration Gorilla Interrupted (2003). "How Not to Make a Movie" also shows the restoration process of remastering this ancient schlock no budget flop.', NULL, 'how-not-to-make-a-movie.jpg', '2017-09-10 11:23:47', '2017-09-10 11:23:47', 'movie'),
	(18, 'IT: Part 1', 'In 1960, seven pre-teen outcasts fight an evil demon who poses as a child-killing clown.', NULL, 'it.jpg', '2017-09-10 11:26:10', '2017-09-10 11:26:10', 'movie'),
	(19, 'IT: Part 2', 'Thirty years later, the Losers Club reunites to stop Pennywise once and for all when IT reawakens.', NULL, 'it.jpg', '2017-09-10 11:27:55', '2017-09-10 11:27:55', 'movie'),
	(20, 'Iron Man 3', 'When Tony Stark\'s world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.', NULL, 'iron-man-3.jpg', '2017-09-10 11:31:31', '2017-09-10 11:31:31', 'movie'),
	(21, 'John Dies at the End', 'A new street drug that sends its users across time and dimensions has one drawback: some people return as no longer human. Can two college dropouts save humankind from this silent, otherworldly invasion?', NULL, 'john-dies-at-the-end.jpg', '2017-09-10 11:35:48', '2017-09-10 11:35:48', 'movie'),
	(22, 'Justice League: Crisis on Two Earths', 'A good version of Lex Luthor from a parallel Earth comes to the Justice League\'s dimension for help to fight their evil counterparts.', NULL, 'justice-league-crisis-on-two-earths.jpg', '2017-09-10 11:38:30', '2017-09-10 11:38:30', 'movie'),
	(23, 'Justice League: The Flashpoint Paradox', 'The Flash finds himself in a war torn alternate timeline and teams up with alternate versions of his fellow heroes to return home and restore the timeline.', NULL, 'justice-league-the-flashpoint-paradox.jpg', '2017-09-10 11:40:35', '2017-09-10 11:40:35', 'movie'),
	(24, 'Justice League: War', 'The world\'s finest heroes found the Justice League in order to stop an alien invasion of Earth.', NULL, 'justice-league-war.jpg', '2017-09-10 11:43:09', '2017-09-10 11:43:09', 'movie'),
	(25, 'Krampus', 'A boy who has a bad Christmas ends up accidentally summoning a festive demon to his family home.', NULL, 'krampus.jpg', '2017-09-10 11:44:44', '2017-09-10 11:44:44', 'movie'),
	(26, 'Logan', 'In the near future, a weary Logan cares for an ailing Professor X, somewhere on the Mexican border. However, Logan\'s attempts to hide from the world, and his legacy, are upended when a young mutant arrives, pursued by dark forces.', NULL, 'logan.jpg', '2017-09-10 11:46:53', '2017-09-10 11:46:53', 'movie'),
	(27, 'Mad Max: Fury Road', 'A woman rebels against a tyrannical ruler in postapocalyptic Australia in search for her home-land with the help of a group of female prisoners, a psychotic worshipper, and a drifter named Max.', NULL, 'mad-max-fury-road.jpg', '2017-09-10 11:48:56', '2017-09-10 11:48:56', 'movie'),
	(28, 'Necronomicon: Book of the Dead', 'While studying the fabled Necronomicon, H.P. Lovecraft reads three greusome tales of terror.', NULL, 'necronomicon-book-of-the-dead.jpg', '2017-09-10 11:55:42', '2017-09-10 11:55:42', 'movie'),
	(29, 'Office Space', 'Three software developers who hate their jobs decide to rebel against their greedy boss.', NULL, 'office-space.jpg', '2017-09-10 11:57:22', '2017-09-10 11:57:22', 'movie'),
	(30, 'Patton Oswalt: My Weakness is Strong', 'The critically-acclaimed comedian, actor, and writer takes time off from his many film and television outings to return to the comedy stage for his fourth stand-up special.', NULL, 'my-weakness-is-strong.jpg', '2017-09-10 12:02:28', '2017-09-10 12:02:28', 'movie'),
	(31, 'Star Wars: Episode IV - A New Hope', 'Luke Skywalker joins forces with a Jedi Knight, a cocky pilot, a Wookiee, and two droids to save the galaxy from the Empire\'s world-destroying battle-station, while also attempting to rescue Princess Leia from the evil Darth Vader.', NULL, 'star-wars.jpg', '2017-09-10 12:05:16', '2017-09-10 12:05:16', 'movie'),
	(32, 'Star Wars: Episode V - The Empire Strikes Back', 'After the rebels are overpowered by the Empire on their newly established base, Luke Skywalker begins Jedi training with Master Yoda. His friends accept shelter from a questionable ally as Darth Vader hunts them in a plan to capture Luke.', NULL, 'empire-strikes-back.jpg', '2017-09-10 12:10:20', '2017-09-10 12:10:20', 'movie'),
	(33, 'Star Wars: Episode VI - Return of the Jedi', 'After a daring mission to rescue Han Solo from Jabba the Hutt, the rebels dispatch to Endor to destroy a more powerful Death Star. Meanwhile, Luke struggles to help Vader back from the dark side without falling into the Emperor\'s trap.', NULL, 'return-of-the-jedi.jpg', '2017-09-10 12:11:47', '2017-09-10 12:11:47', 'movie'),
	(34, 'The Amazing Spider-Man', 'After Peter Parker is bitten by a genetically altered spider, he gains newfound, spider-like powers and ventures out to solve the mystery of his parent\'s mysterious death.', NULL, 'amazing-spider-man.jpg', '2017-09-10 12:13:17', '2017-09-10 12:13:17', 'movie'),
	(35, 'The Matrix', 'A computer hacker learns from mysterious rebels about the true nature of his reality and his role in the war against its controllers.', NULL, 'the-matrix.jpg', '2017-09-10 12:14:15', '2017-09-10 12:14:15', 'movie'),
	(36, 'Unbreakable', 'After miracuously walking away from a catastrophic train crash, a man is contacted by an eccentric comic book collector who claims that his lack of injuries are the result of amazing superhuman abilities.', NULL, 'unbreakable.jpg', '2017-09-10 12:19:13', '2017-09-10 12:19:13', 'movie'),
	(37, 'V for Vendetta', 'In a future British tyranny, a shadowy freedom fighter, known only by the alias of "V", plots to overthrow it with the help of a young woman.', NULL, 'v-for-vendetta.jpg', '2017-09-10 12:21:47', '2017-09-10 12:21:47', 'movie'),
	(38, 'Trick \'r Treat', 'Five interwoven stories that occur on Halloween: An everyday high school principal has a secret life as a serial killer; a college virgin might have just met the guy for her; a group of teenagers pull a mean prank; a woman who loathes the night has to contend with her holiday-obsessed husband; and a mean old man meets his match with a demonic, supernatural trick-or-treater.', NULL, 'trick-r-treat.jpg', '2017-09-14 19:41:27', '2017-09-14 19:41:27', 'movie'),
	(39, 'Back to the Future', 'Marty McFly, a 17-year-old high school student, is accidentally sent 30 years into the past in a time-traveling DeLorean invented by his close friend, the maverick scientist Doc Brown.', NULL, 'back-to-the-future.jpg', '2017-09-19 19:37:34', '2017-09-19 19:37:34', 'movie'),
	(40, 'Back to the Future Part II', 'After visiting 2015, Marty McFly must repeat his visit to 1955 to prevent disastrous changes to 1985, without interfering with his first trip.', NULL, 'back-to-the-future-2.jpg', '2017-09-19 19:44:28', '2017-09-19 19:44:28', 'movie'),
	(41, 'Back to the Future Part III', 'Enjoying a peaceful existence in 1885, Doctor Emmett Brown is about to be killed by Buford "Mad Dog" Tannen. Marty McFly travels back in time to save him.', NULL, 'back-to-the-future-3.jpg', '2017-09-19 19:47:16', '2017-09-19 19:47:16', 'movie'),
	(42, 'Mystery Men', 'A group of inept, amateur crime-fighters must try to save the day when a supervillian threatens to kill a beloved superhero and destroy all of Empire City.', NULL, 'mystery-men.jpg', '2017-09-27 20:39:54', '2017-09-27 20:39:54', 'movie'),
	(43, 'Star Wars: Episode VII - The Force Awakens', 'Three decades after the Empire\'s defeat, a new threat arises in the militant First Order. A stormtrooper defector Finn and a scavenger named Rey are caught up in the Resistance\'s search for the missing Luke Skywalker.', NULL, 'force-awakens.jpg', '2017-09-27 20:42:34', '2017-09-27 20:42:34', 'movie'),
	(44, 'True Lies', 'A fearless, globe-trotting, terrorist-battling secret agent has his life turned upside down when he discovers his wife might be having an affair with a used car salesman while terrorists smuggle nuclear war heads into the United States.', NULL, 'true-lies.jpg', '2017-09-27 20:45:22', '2017-09-27 20:45:22', 'movie'),
	(45, 'Looper', 'In 2074, when the mob wants to get rid of someone, the target is sent into the past where a hired gun called a Looper awaits - someone like Joe - who one day learns the mob wants to \'close his loop\' by sending back Joe\'s future self for assassination.', NULL, 'looper.jpg', '2017-09-30 18:47:14', '2017-09-30 18:47:14', 'movie'),
	(46, 'Guardians of the Galaxy', 'A group of intergalactic criminals are forced to work together to stop a fanatical warrior from taking control of the universe.', NULL, 'guardians-of-the-galaxy.jpg', '2017-10-01 10:45:24', '2017-10-01 10:45:24', 'movie'),
	(47, 'Fright Night', 'When a teenager learns that his new next door neighbor is a vampire, he seeks the help of a local actor who plays a vampire hunter on TV.', NULL, 'fright-night.jpg', '2017-10-01 11:58:49', '2017-10-01 11:58:49', 'movie'),
	(48, 'Galaxy Quest', 'The alumni cast of a space opera television series have to play their roles as the real thing when an alien race needs their help.', NULL, 'galaxy-quest.jpg', '2017-10-01 12:01:04', '2017-10-01 12:01:04', 'movie'),
	(49, 'Hot Fuzz', 'A skilled London police officer is transferred to a small town that\'s harbouring a dark secret.', NULL, 'hot-fuzz.jpg', '2017-10-01 12:01:34', '2017-10-01 12:01:34', 'movie'),
	(50, 'Kingsman: The Secret Service', 'A spy organization recruits an unrefined, but promising street kid into the agency\'s ultra-competitive training program, just as a global threat emerges from a twisted tech genius.', NULL, 'kingsman.jpg', '2017-10-01 12:02:22', '2017-10-01 12:02:22', 'movie'),
	(51, 'Shaun of the Dead', 'A man decides to turn his moribund life around by winning back his ex-girlfriend, reconciling his relationship with his mother, and dealing with an entire community that has returned from the dead to eat the living.', NULL, 'shaun-of-the-dead.jpg', '2017-10-01 12:03:16', '2017-10-01 12:03:16', 'movie'),
	(52, 'Spider-Man 2', 'Peter Parker is beset with troubles in his failing personal life as he battles a brilliant scientist named Doctor Otto Octavius.', NULL, 'spider-man-2.jpg', '2017-10-01 12:04:07', '2017-10-01 12:04:07', 'movie'),
	(53, 'Spider-Man 3', 'A strange black entity from another world bonds with Peter Parker and causes inner turmoil as he contends with new villains, temptations, and revenge.', NULL, 'spider-man-3.jpg', '2017-10-01 12:04:38', '2017-10-01 12:04:38', 'movie'),
	(54, 'Spider-Man', 'When bitten by a genetically modified spider, a nerdy, shy, and awkward high school student gains spider-like abilities that he eventually must use to fight evil as a superhero after tragedy befalls his family.', NULL, 'spider-man.jpg', '2017-10-01 12:05:05', '2017-10-01 12:05:05', 'movie'),
	(55, 'The Fly', 'A brilliant but eccentric scientist begins to transform into a giant man/fly hybrid after one of his experiments goes horribly wrong.', NULL, 'the-fly.jpg', '2017-10-01 12:05:32', '2017-10-01 12:05:32', 'movie'),
	(56, 'Total Recall', 'When a man goes for virtual vacation memories of the planet Mars, an unexpected and harrowing series of events forces him to go to the planet for real - or does he?', NULL, 'total-recall.jpg', '2017-10-01 12:06:39', '2017-10-01 12:06:39', 'movie'),
	(57, 'Creepshow', 'An anthology which tells five terrifying tales based on the E.C. horror comic books of the 1950s.', NULL, 'creepshow.jpg', '2017-10-01 14:43:32', '2017-10-01 14:43:32', 'movie'),
	(58, 'Dredd', 'In a violent, futuristic city where the police have the authority to act as judge, jury and executioner, a cop teams with a trainee to take down a gang that deals the reality-altering drug, SLO-MO.', NULL, 'dredd.jpg', '2017-10-01 14:44:17', '2017-10-01 14:44:17', 'movie'),
	(59, 'Sherlock Holmes', 'Detective Sherlock Holmes and his stalwart partner Watson engage in a battle of wits and brawn with a nemesis whose plot is a threat to all of England.', NULL, 'sherlock-holmes.jpg', '2017-10-06 17:20:07', '2017-10-06 17:20:07', 'movie'),
	(60, 'Batman Begins', 'After training with his mentor, Batman begins his fight to free crime-ridden Gotham City from the corruption that Scarecrow and the League of Shadows have cast upon it.', NULL, 'batman-begins.jpg', '2017-10-07 16:53:54', '2017-10-07 16:53:54', 'movie'),
	(61, 'Casino Royale', 'Armed with a license to kill, Secret Agent James Bond sets out on his first mission as 007, and must defeat a private banker to terrorists in a high stakes game of poker at Casino Royale, Montenegro, but things are not what they seem.', NULL, 'casino-royale.jpg', '2017-10-07 16:56:32', '2017-10-07 16:56:32', 'movie'),
	(62, 'Creepshow 2', 'Three more bone-chilling tales that include a vengeful wooden Native American, a monstrous blob in a lake, and a hitchhiker who wants revenge and will not die.', NULL, 'creepshow-2.jpg', '2017-10-07 16:58:51', '2017-10-07 16:58:51', 'movie'),
	(63, 'Django Unchained', 'With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.', NULL, 'django-unchained.jpg', '2017-10-07 17:00:44', '2017-10-07 17:00:44', 'movie'),
	(64, 'Elvira: Mistress of the Dark', 'Upon arriving in a small town where she has inherited a rundown mansion, a famous horror hostess battles an evil uncle who wants her burned at the stake.', NULL, 'elvira-mistress-of-the-dark.jpg', '2017-10-07 17:02:34', '2017-10-07 17:02:34', 'movie'),
	(65, 'Evil Dead 2: Dead by Dawn', 'The lone survivor of an onslaught of flesh-possessing spirits holes up in a cabin with a group of strangers while the demons continue their attack.', NULL, 'evil-dead-2.jpg', '2017-10-07 17:04:00', '2017-10-07 17:04:00', 'movie'),
	(66, 'Ghostbusters 2', 'The discovery of a massive river of ectoplasm and a resurgence of spectral activity allows the staff of Ghostbusters to revive the business.', NULL, 'ghostbusters-2.jpg', '2017-10-07 17:05:38', '2017-10-07 17:05:38', 'movie'),
	(67, 'Indiana Jones and the Last Crusade', 'When Dr. Henry Jones, Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Dr. Henry "Indiana" Jones, Jr. must follow in his father\'s footsteps to stop the Nazis from getting their hands on the Holy Grail first.', NULL, 'last-crusade.jpg', '2017-10-07 17:09:05', '2017-10-07 17:09:05', 'movie'),
	(68, 'Indiana Jones and the Raiders of the Lost Ark', 'Archaeologist and adventurer Indiana Jones is hired by the U.S. government to find the Ark of the Covenant before the Nazis.', NULL, 'raiders-of-the-lost-ark.jpg', '2017-10-07 17:10:07', '2017-10-07 17:10:07', 'movie'),
	(69, 'Indiana Jones and the Temple of Doom', 'After arriving in India, Indiana Jones is asked by a desperate village to find a mystical stone. He agrees, and stumbles upon a secret cult plotting a terrible plan in the catacombs of an ancient palace.', NULL, 'temple-of-doom.jpg', '2017-10-07 17:10:45', '2017-10-07 17:10:45', 'movie'),
	(70, 'It Follows', 'A young woman is followed by an unknown supernatural force after a sexual encounter.', NULL, 'it-follows.jpg', '2017-10-07 17:11:25', '2017-10-07 17:11:25', 'movie'),
	(71, 'Night of the Demons', 'Ten teenagers party at an abandoned funeral parlor on Halloween night. When an evil force awakens, demonic spirits keep them from leaving and turn their gathering into a living Hell.', NULL, 'night-of-the-demons.jpg', '2017-10-07 17:15:05', '2017-10-07 17:15:05', 'movie'),
	(72, 'The Cabin in the Woods', 'Five friends go for a break at a remote cabin, where they get more than they bargained for, discovering the truth behind the cabin in the woods.', NULL, 'cabin-in-the-woods.jpg', '2017-10-07 17:16:04', '2017-10-07 17:16:04', 'movie'),
	(73, 'The Dark Knight Rises', 'Eight years after the Joker\'s reign of anarchy, the Dark Knight, with the help of the enigmatic Catwoman, is forced from his exile to save Gotham City, now on the edge of total annihilation, from the brutal guerrilla terrorist Bane.', NULL, 'the-dark-knight-rises.jpg', '2017-10-07 17:18:09', '2017-10-07 17:18:09', 'movie'),
	(74, 'The Dark Knight', 'When the menace known as the Joker emerges from his mysterious past, he wreaks havoc and chaos on the people of Gotham, the Dark Knight must accept one of the greatest psychological and physical tests of his ability to fight injustice.', NULL, 'the-dark-knight.jpg', '2017-10-07 17:20:05', '2017-10-07 17:20:05', 'movie'),
	(75, 'The Evil Dead', 'Five friends travel to a cabin in the woods, where they unknowingly release flesh-possessing demons.', NULL, 'evil-dead.jpg', '2017-10-07 17:23:32', '2017-10-07 17:23:32', 'movie'),
	(76, 'The World\'s End', 'Five friends who reunite in an attempt to top their epic pub crawl from twenty years earlier unwittingly become humanity\'s only hope for survival.', NULL, 'the-worlds-end.jpg', '2017-10-07 17:25:31', '2017-10-07 17:25:31', 'movie'),
	(77, 'Army of Darkness', 'A man is accidentally transported to 1300 A.D., where he must battle an army of the dead and retrieve the Necronomicon so he can return home.', NULL, 'army-of-darkness.jpg', '2017-10-07 22:15:28', '2017-10-07 22:15:28', 'movie'),
	(78, 'Batman: Gotham Knight', 'A collection of key events mark Bruce Wayne\'s life, as he journeys from beginner to Dark Knight.', NULL, 'batman-gotham-knight.jpg', '2017-10-07 22:18:04', '2017-10-07 22:18:04', 'movie'),
	(79, 'Batman: Year One', 'A wealthy playboy and a Chicago cop both return to Gotham City where their lives will intersect in unexpected ways.', NULL, 'batman-year-one.jpg', '2017-10-07 22:22:34', '2017-10-07 22:22:34', 'movie'),
	(80, 'Get Out', 'It\'s time for a young African American to meet with his white girlfriend\'s parents for a weekend in their secluded estate in the woods, but before long, the friendly and polite ambiance will give way to a nightmare.', NULL, 'get-out.jpg', '2017-10-07 22:24:49', '2017-10-07 22:24:49', 'movie'),
	(81, 'Tremors', 'Natives of a small isolated town defend themselves against strange underground creatures which are killing them one by one.', NULL, 'tremors.jpg', '2017-10-07 22:26:26', '2017-10-07 22:26:26', 'movie'),
	(82, 'Watchmen', 'In 1985 where former superheroes exist, the murder of a colleague sends active vigilante Rorschach into his own sprawling investigation, uncovering something that could completely change the course of history as we know it.', NULL, 'watchmen.jpg', '2017-10-07 22:28:38', '2017-10-07 22:28:38', 'movie'),
	(83, 'X-Men: Days of Future Past', 'The X-Men send Wolverine to the past in a desperate effort to change history and prevent an event that results in doom for both humans and mutants.', NULL, 'days-of-future-past.jpg', '2017-10-07 22:31:01', '2017-10-07 22:31:01', 'movie'),
	(84, 'Tales from the Crypt: Demon Knight', 'A mysterious man on the run is hunted by a demon known as the Collector who poses as a small-town sheriff.', NULL, 'demon-knight.jpg', '2017-10-08 09:20:23', '2017-10-08 09:20:23', 'movie'),
	(85, 'The LEGO Movie', 'An ordinary Lego construction worker, thought to be the prophesied \'Special\', is recruited to join a quest to stop an evil tyrant from gluing the Lego universe into eternal stasis.', NULL, 'lego-movie.jpg', '2017-10-08 09:22:30', '2017-10-08 09:22:30', 'movie'),
	(86, 'The Mist', 'A freak storm unleashes a series of bloodthirsty creatures on a quiet town, where a small band of citizens hole up in a supermarket and fight for their lives.', NULL, 'the-mist.jpg', '2017-10-08 09:25:24', '2017-10-08 09:25:24', 'movie'),
	(87, 'The Raid: Redemption', 'A S.W.A.T. team becomes trapped in a tenement run by a ruthless mobster and his army of killers and thugs.', '<br /><br /><span class="modal-extra-info">(Indonesian with English subtitles)</span>', 'the-raid-redemption.jpg', '2017-10-08 19:21:38', '2017-10-08 19:21:38', 'movie'),
	(88, 'Iron Man', 'After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.', NULL, 'iron-man.jpg', '2017-10-13 19:38:12', '2017-10-13 19:38:12', 'movie'),
	(89, 'Pacific Rim', 'As a war between mankind and monstrous sea creatures wages on, a former pilot and a trainee are paired up to drive a seemingly obsolete special weapon in a desperate effort to save the world from the apocalypse.', NULL, 'pacific-rim.jpg', '2017-10-13 19:39:33', '2017-10-13 19:39:33', 'movie'),
	(90, 'Predator 2', 'Amidst a territorial gang war in 1997, a sophisticated alien hunter stalks the citizens of Los Angeles and the only man between him and his prey is veteran L.A.P.D. officer, Lieutenant Mike Harrigan.', NULL, 'predator-2.jpg', '2017-10-13 19:40:14', '2017-10-13 19:40:14', 'movie'),
	(91, 'Predator', 'A team of commandos on a mission in a Central American jungle find themselves being stalked by an extraterrestrial hunter.', NULL, 'predator.jpg', '2017-10-13 19:41:05', '2017-10-13 19:41:05', 'movie'),
	(92, 'Captain America: The Winter Soldier', 'As Steve Rogers struggles to embrace his role in the modern world, he teams up with a fellow Avenger and S.H.I.E.L.D. agent, Black Widow, to battle a new threat from history: an assassin known as the Winter Soldier.', NULL, 'winter-soldier.jpg', '2017-10-15 10:01:02', '2017-10-15 10:01:02', 'movie'),
	(93, 'Captain America: Civil War', 'Political interference in the Avengers\' activities causes a rift between former allies Captain America and Iron Man.', NULL, 'civil-war.jpg', '2017-10-15 21:31:58', '2017-10-15 21:31:58', 'movie'),
	(94, 'Spider-Man: Homecoming', 'Peter Parker balances his life as an ordinary high school student in Queens with his superhero alter-ego Spider-Man, and finds himself on the trail of a new menace prowling the skies of New York City.', NULL, 'spiderman-homecoming.jpg', '2017-10-18 20:57:32', '2017-10-18 20:57:32', 'movie'),
	(95, 'Batman: The Dark Knight Returns, Part 1', 'Batman has not been seen for ten years. A new breed of criminal ravages Gotham City, forcing 55-year-old Bruce Wayne back into the cape and cowl. But, does he still have what it takes to fight crime in a new era?', NULL, 'dark-knight-returns-part-1.jpg', '2017-10-20 23:20:23', '2017-10-20 23:20:23', 'movie'),
	(96, 'Batman: The Dark Knight Returns, Part 2', 'The Batman has returned after a 10-year absence. The Gotham authorities want to arrest him. An old foe wants a reunion. The Feds want the Man of Tomorrow to put a stop to him.', NULL, 'dark-knight-returns-part-2.jpg', '2017-10-21 09:50:08', '2017-10-21 09:50:08', 'movie'),
	(97, 'From Dusk Till Dawn', 'Two criminals and their hostages unknowingly seek temporary refuge in an establishment populated by vampires, with chaotic results.', NULL, 'from-dusk-till-dawn.jpg', '2017-10-21 12:27:04', '2017-10-21 12:27:04', 'movie'),
	(98, 'Iron Man 2', 'With the world now aware of his identity as Iron Man, Tony Stark must contend with both his declining health and a vengeful mad man with ties to his father\'s legacy.', NULL, 'iron-man-2.jpg', '2017-10-21 12:28:24', '2017-10-21 12:28:24', 'movie'),
	(99, 'Evil Dead', 'Five friends head to a remote cabin, where the discovery of a Book of the Dead leads them to unwittingly summon up demons living in the nearby woods.', NULL, 'evil-dead-2013.jpg', '2017-10-24 20:37:27', '2017-10-24 20:37:27', 'movie'),
	(100, 'The Witch', 'A family in 1630s New England is torn apart by the forces of witchcraft, black magic and possession.', NULL, 'the-witch.jpg', '2017-10-28 11:12:09', '2017-10-28 11:12:09', 'movie'),
	(101, 'Arrival', 'When twelve mysterious spacecraft appear around the world, linguistics professor Louise Banks is tasked with interpreting the language of the alien visitors.', NULL, 'arrival.jpg', '2017-10-28 12:18:18', '2017-10-28 12:18:18', 'movie'),
	(102, 'The Amazing Spider-Man 2', 'When New York is put under siege by Oscorp, it is up to Spider-Man to save the city he swore to protect as well as his loved ones.', NULL, 'amazing-spider-man-2.jpg', '2017-10-28 14:20:22', '2017-10-28 14:20:22', 'movie'),
	(103, 'Men in Black', 'A police officer joins a secret organization that polices and monitors extraterrestrial interactions on Earth.', NULL, 'men-in-black.jpg', '2017-10-28 15:50:28', '2017-10-28 15:50:28', 'movie'),
	(104, 'Ant-Man', 'Armed with a super-suit with the astonishing ability to shrink in scale but increase in strength, cat burglar Scott Lang must embrace his inner hero and help his mentor, Dr. Hank Pym, plan and pull off a heist that will save the world.', NULL, 'ant-man.jpg', '2017-10-28 16:07:59', '2017-10-28 16:07:59', 'movie'),
	(105, 'Rogue One: A Star Wars Story', 'Jyn Erso leads the Rebel Alliance in a risky move to steal the plans for the Death Star, setting up the epic saga to follow.', NULL, 'rogue-one.jpg', '2017-10-28 18:32:50', '2017-10-28 18:32:50', 'movie'),
	(106, 'The Avengers', 'Earth\'s mightiest heroes must come together and learn to fight as a team if they are going to stop the mischievous Loki and his alien army from enslaving humanity.', NULL, 'the-avengers.jpg', '2017-10-29 12:39:51', '2017-10-29 12:39:51', 'movie'),
	(107, 'Avengers: Age of Ultron', 'When Tony Stark and Bruce Banner try to jump-start a dormant peacekeeping program called Ultron, things go horribly wrong and it\'s up to Earth\'s mightiest heroes to stop the villainous AI from enacting his terrible plan.', NULL, 'avengers-age-of-ultron.jpg', '2017-10-29 15:58:01', '2017-10-29 15:58:01', 'movie'),
	(108, 'Split', 'After being kidnapped by a man with multiple personalities, three young girls must try to find a way to escape before their mysterious captor unleashes his newest persona: The Beast.', NULL, 'split.jpg', '2017-10-31 20:30:03', '2017-10-31 20:30:03', 'movie'),
	(109, 'Star Trek: Beyond', 'The U.S.S. Enterprise crew explores the furthest reaches of uncharted space, where they encounter a new ruthless enemy, who puts them, and everything the Federation stands for, to the test.', NULL, 'star-trek-beyond.jpg', '2017-11-01 20:05:02', '2017-11-01 20:05:02', 'movie'),
	(110, 'Doctor Strange', 'While on a journey of physical and spiritual healing, a brilliant neurosurgeon is drawn into the world of the mystic arts.', NULL, 'doctor-strange.jpg', '2017-11-02 20:29:20', '2017-11-02 20:29:20', 'movie'),
	(111, 'John Wick', 'An ex-hitman comes out of retirement to track down the gangsters that took everything from him.', NULL, 'john-wick.jpg', '2017-11-03 20:11:08', '2017-11-03 20:11:08', 'movie'),
	(112, 'The Dark Tower', 'The last Gunslinger, Roland Deschain, has been locked in an eternal battle with Walter O\'Dim, also known as the Man in Black, determined to prevent him from toppling the Dark Tower, which holds the universe together. With the fate of the worlds at stake, good and evil will collide in the ultimate battle as only Roland can defend the Tower from the Man in Black.', NULL, 'the-dark-tower.jpg', '2017-11-04 10:58:56', '2017-11-04 10:58:56', 'movie'),
	(113, '10 Cloverfield Lane', 'After getting in a car accident, a woman is held in a bomb shelter with two strangers who claim the outside world has been affected by an attack from an unknown source.', NULL, '10-cloverfield-lane.jpg', '2017-11-05 18:29:06', '2017-11-05 18:29:06', 'movie'),
	(114, 'Bowfinger', 'When a desperate movie producer fails to get a major star for his bargain basement film, he decides to shoot the film secretly around him.', NULL, 'bowfinger.jpg', '2017-11-23 09:34:39', '2017-11-23 09:34:39', 'movie'),
	(115, 'Jurassic Park', 'During a preview tour, a theme park suffers a major power breakdown that allows its cloned dinosaur exhibits to run amok.', NULL, 'jurassic-park.jpg', '2017-11-24 14:45:03', '2017-11-24 14:45:03', 'movie'),
	(116, 'The Forbidden Kingdom', 'A martial arts obsessed American teen is sent on an adventure back in time to ancient China where he joins forces with a drunken kung fu master, a monk, and a beautiful warrior out for revenge in a quest to free the imprisoned Monkey King.', NULL, 'forbidden-kingdom.jpg', '2017-11-25 15:49:03', '2017-11-25 15:49:03', 'movie'),
	(117, 'Jaws', 'A giant great white shark arrives on the shores of a New England beach resort and wreaks havoc with bloody attacks on swimmers, until a local sheriff teams up with a marine biologist and an old seafarer to hunt the monster down.', NULL, 'jaws.jpg', '2017-11-25 16:13:23', '2017-11-25 16:13:23', 'movie'),
	(118, 'The Mummy', 'An American serving in the French Foreign Legion on an archaeological dig at the ancient city of Hamunaptra accidentally awakens a mummy that wreaks havoc on him, and his crew.', NULL, 'the-mummy.jpg', '2017-11-25 17:32:00', '2017-11-25 17:32:00', 'movie'),
	(119, 'Beetlejuice', 'When a recently deceased couple find their now-vacant home invaded by an obnoxious family, they hire a sleazy ghost and self-proclaimed "bio-exorcist" to help them scare away their unwanted tenants.', NULL, 'beetlejuice.jpg', '2017-12-02 17:17:05', '2017-12-02 17:17:05', 'movie'),
	(120, 'The Incredibles', 'A family of undercover superheroes, while trying to live the quiet suburban life, are forced into action to save the world.', NULL, 'the-incredibles.jpg', '2017-12-15 16:49:17', '2017-12-15 16:49:17', 'movie'),
	(121, 'Star Trek', 'The brash James T. Kirk tries to live up to his father\'s legacy with Mr. Spock keeping him in check as a vengeful Romulan from the future creates black holes to destroy the Federation one planet at a time.', NULL, 'star-trek.jpg', '2017-12-15 17:14:54', '2017-12-15 17:14:54', 'movie'),
	(122, 'From Beyond', 'A group of scientists have developed the Resonator, a machine which allows whoever is within range to see beyond normal perceptible reality. But when the experiment succeeds, they are immediately attacked by terrible life forms.', NULL, 'from-beyond.jpg', '2017-12-16 17:09:26', '2017-12-16 17:09:26', 'movie'),
	(123, 'Starship Troopers', 'Humans in a fascistic, militaristic future do battle with giant alien bugs in a fight for survival.', NULL, 'starship-troopers.jpg', '2017-12-16 17:10:51', '2017-12-16 17:10:51', 'movie'),
	(124, 'Tropic Thunder', 'Through a series of freak occurrences, a group of actors shooting a big-budget war movie are forced to become the soldiers they are portraying.', NULL, 'tropic-thunder.jpg', '2017-12-16 17:11:56', '2017-12-16 17:11:56', 'movie'),
	(125, 'Let Me In', 'A bullied young boy befriends a young female vampire who lives in secrecy with her guardian.', NULL, 'let-me-in.jpg', '2017-12-30 14:21:37', '2017-12-30 14:21:37', 'movie'),
	(126, 'Interstellar', 'A team of explorers travel through a wormhole in space in an attempt to ensure the survival of the human race.', NULL, 'interstellar.jpg', '2017-12-31 09:58:05', '2017-12-31 09:58:05', 'movie'),
	(127, 'Predators', 'A group of elite warriors parachute into an unfamiliar jungle and are hunted by members of a merciless alien race.', NULL, 'predators.jpg', '2017-12-31 10:00:36', '2017-12-31 10:00:36', 'movie'),
	(128, 'Serenity', 'The crew of the ship Serenity try to evade an assassin sent to recapture one of their members: a telepath with valuable, and dangerous knowledge.', NULL, 'serenity.jpg', '2017-12-31 10:04:31', '2017-12-31 10:04:31', 'movie'),
	(129, 'Space Cop', 'Space Cop is the story of a cop from the future of space who travels back in time to the present and is teamed up with a cop from the past who is unfrozen in the present. Together, they must defeat evil aliens with a sinister plan.', NULL, 'space-cop.jpg', '2017-12-31 10:09:42', '2017-12-31 10:09:42', 'movie'),
	(130, 'Space Cop (with audio commentary)', 'Space Cop is the story of a cop from the future of space who travels back in time to the present and is teamed up with a cop from the past who is unfrozen in the present. Together, they must defeat evil aliens with a sinister plan.', '<br /><br /><span class="modal-extra-info">(Features audio commentary by Mike Stoklasa, Jay Bauman, and Rich Evans of Red Letter Media)</span>', 'space-cop-commentary.jpg', '2017-12-31 12:02:56', '2017-12-31 12:02:56', 'movie'),
	(131, 'Batman', 'The Dark Knight of Gotham City begins his war on crime with his first major enemy being the clownishly homicidal Joker.', NULL, 'batman.jpg', '2017-12-31 16:54:12', '2017-12-31 16:54:12', 'movie'),
	(132, 'Batman Returns', 'When a corrupt businessman and the grotesque Penguin plot to take control of Gotham City, only Batman can stop them, while the Catwoman has her own agenda.', NULL, 'batman-returns.jpg', '2017-12-31 16:57:10', '2017-12-31 16:57:10', 'movie'),
	(133, 'Gremlins', 'A boy inadvertently breaks three important rules concerning his new pet and unleashes a horde of malevolently mischievous monsters on a small town.', NULL, 'gremlins.jpg', '2018-01-01 17:04:58', '2018-01-01 17:04:58', 'movie'),
	(134, 'Poltergeist', 'After young Carol Anne is taken by malevolent spirits, her family enlists the help of a group of paranormal researchers and a mysterious psychic.', NULL, 'poltergeist.jpg', '2018-01-01 17:12:06', '2018-01-01 17:12:06', 'movie'),
	(135, 'The Thing', 'A crew in Antarctica finds a neighboring camp destroyed and its crew dead. Whatever killed them is nowhere to be found, unless it\'s hidden in plain sight.', NULL, 'the-thing.jpg', '2018-01-04 11:33:08', '2018-01-04 11:33:08', 'movie'),
	(136, 'Prometheus', 'A group of scientists and explorers set out to the deepest reaches of space in order to discover the origins of our species, but what they find may spell doom for the entire human race.', NULL, 'prometheus.jpg', '2018-01-05 21:14:08', '2018-01-05 21:14:08', 'movie'),
	(137, 'This is the End', 'While attending a party at James Franco\'s house, Seth Rogen, Jay Baruchel and many other celebrities are faced with the Biblical Apocalypse.', NULL, 'this-is-the-end.jpg', '2018-01-05 21:16:19', '2018-01-05 21:16:19', 'movie'),
	(138, 'IT', 'A group of bullied kids band together when a shapeshifting monster, taking the appearance of a clown, begins hunting children.', NULL, 'it-2017.jpg', '2018-01-13 14:56:04', '2018-01-13 14:56:04', 'movie'),
	(139, 'District 9', 'An extraterrestrial race forced to live in slum-like conditions on Earth suddenly finds a kindred spirit in a government agent who is exposed to their biotechnology.', NULL, 'district-9.jpg', '2018-01-20 15:46:33', '2018-01-20 15:46:33', 'movie'),
	(140, 'Gods of Egypt', 'Mortal hero Bek teams with the god Horus in an alliance against Set, the merciless god of darkness, who has usurped Egypt\'s throne, plunging the once peaceful and prosperous empire into chaos and conflict.', NULL, 'gods-of-egypt.jpg', '2018-01-20 15:47:45', '2018-01-20 15:47:45', 'movie'),
	(141, 'Hansel and Gretel: Witch Hunters', 'Hansel & Gretel are bounty hunters who track and kill witches all over the world. As the fabled Blood Moon approaches, the siblings encounter a new form of evil that might hold a secret to their past.', NULL, 'hansel-and-gretel-witch-hunters.jpg', '2018-02-02 18:31:06', '2018-02-02 18:31:06', 'movie'),
	(142, 'Inception', 'A thief, who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a CEO.', NULL, 'inception.jpg', '2018-02-02 18:32:30', '2018-02-02 18:32:30', 'movie'),
	(143, 'Independence Day: Resurgence', 'Two decades after the first Independence Day invasion, Earth is faced with a new extra-Solar threat. But will mankind\'s new space defenses be enough?', NULL, 'independence-day-resurgence.jpg', '2018-02-02 18:33:35', '2018-02-02 18:33:35', 'movie'),
	(144, 'Jeepers Creepers 2', 'Set a few days after the original, a championship basketball team\'s bus is attacked by The Creeper, the winged, flesh-eating terror, on the last day of his 23-day feeding frenzy.', NULL, 'jeepers-creepers-2.jpg', '2018-02-02 18:36:09', '2018-02-02 18:36:09', 'movie'),
	(145, 'Jeepers Creepers', 'A brother and sister driving home through the isolated countryside for spring break encounter a flesh-eating creature which is in the midst of it\'s ritualistic eating spree.', NULL, 'jeepers-creepers.jpg', '2018-02-02 18:38:47', '2018-02-02 18:38:47', 'movie'),
	(146, 'The Lost Boys', 'After moving to a new town, two brothers discover that the area is a haven for vampires.', NULL, 'the-lost-boys.jpg', '2018-02-02 18:39:33', '2018-02-02 18:39:33', 'movie'),
	(147, 'The One', 'A rogue agent who works for an organization that polices travel between parallel dimensions goes on a manhunt for alternate versions of himself, getting stronger with each kill. With only one doppelganger remaining, he races against the clock to finish him and become "The One."', NULL, 'the-one.jpg', '2018-02-09 20:18:15', '2018-02-09 20:18:15', 'movie'),
	(148, 'Blade Runner', 'A blade runner must pursue and try to terminate four replicants who have stolen a ship in space and have returned to Earth to find their creator.', NULL, 'blade-runner.jpg', '2018-02-10 14:05:50', '2018-02-10 14:05:50', 'movie'),
	(149, 'The Blob', 'A cheerleader and the local bad-boy outcast try to save their town when it is besieged by a hungry, amorphous creature spawned from a meteorite which consumes everything in it\'s path.', NULL, 'the-blob.jpg', '2018-02-17 17:21:29', '2018-02-17 17:21:29', 'movie'),
	(150, 'Man of Steel', 'Clark Kent, one of the last of an extinguished alien race disguised as an unremarkable human, is forced to reveal his identity when Earth is invaded by an army of fellow survivors from his home-world who threaten to bring Earth to the brink of destruction.', NULL, 'man-of-steel.jpg', '2018-03-03 11:48:03', '2018-03-03 11:48:03', 'movie'),
	(151, 'The Martian', 'An astronaut becomes stranded on Mars after his team assumes him dead. Relying on his ingenuity, he must find a way to signal to Earth that he is alive and survive until he can be rescued.', NULL, 'the-martian.jpg', '2018-03-03 11:54:04', '2018-03-03 11:54:04', 'movie');
INSERT INTO `media` (`id`, `title`, `summary`, `notes`, `poster`, `created_at`, `updated_at`, `media_type`) VALUES
	(152, 'Adventure Time', 'A human boy named Finn and adoptive brother and best friend Jake the Dog, protect the citizens of the Land of Ooo from foes of various shapes and sizes.', NULL, 'adventure-time.jpg', '2017-09-10 14:08:19', '2017-09-10 14:08:19', 'show'),
	(153, 'An Idiot Abroad', 'Brit Karl Pilkington has led a sheltered life. As such, his friends Ricky Gervais and Stephen Merchant decide to send Karl to various parts of the world to experience unfamiliar cultures. For Ricky, this experiment is the most expensive gag for his own pleasure that he ever could have conceived.', NULL, 'an-idiot-abroad.jpg', '2017-09-10 14:17:23', '2017-09-10 14:17:23', 'show'),
	(154, 'Are You Afraid of the Dark?', 'Several young friends form a secretive group, The Midnight Society. Each night they meet in the woods to tell each other scary stories.', NULL, 'are-you-afraid-of-the-dark.jpg', '2017-09-10 14:23:19', '2017-09-10 14:23:19', 'show'),
	(155, 'Batman Tech', 'The History Channel offers a look into the real-world science behind The Dark Knight\'s crime-fighting gadgets.', NULL, 'batman-tech.jpg', '2017-09-10 14:27:44', '2017-09-10 14:27:44', 'show'),
	(156, 'Batman Unmasked: The Psychology of the Dark Knight', 'Various analysts propose a psychological examination of the Dark Knight.', NULL, 'batman-unmasked.jpg', '2017-09-10 14:30:12', '2017-09-10 14:30:12', 'show'),
	(157, 'Bravo\'s 100 Scariest Movie Moments', 'Film-makers, performers, genre authorities and selected high-profile fans count down the most chilling moments in cinematic history.', NULL, 'bravos-100-scariest-movie-moments.jpg', '2017-09-10 14:34:04', '2017-09-10 14:34:04', 'show'),
	(158, 'Bravo\'s 30 Even Scarier Movie Moments', 'In the follow-up to Bravo\'s 100 Scariest Movie Moments, famous actors, directors, and producers count down 30 more spine-chilling scenes from popular genre classics.', NULL, 'bravos-30-even-scarier-movie-moments.jpg', '2017-09-10 14:59:46', '2017-09-10 14:59:46', 'show'),
	(159, 'Game of Thrones', 'Nine noble families fight for control over the mythical lands of Westeros, while a forgotten race returns after being dormant for thousands of years.', NULL, 'game-of-thrones.jpg', '2017-09-10 15:01:40', '2017-09-10 15:01:40', 'show'),
	(160, 'Mystery Science Theater 3000', 'In the not-too-distant future, a man and his robots are trapped aboard the Satellite of Love, where mad scientists force them to sit through the worst movies ever made.', NULL, 'mst3k.jpg', '2017-09-10 15:07:25', '2017-09-10 15:07:25', 'show'),
	(161, 'Night Visions', 'Night Visions is an anthology series similar to The Twilight Zone - some tales are supernatural, others are just commentaries on twisted human nature.', NULL, 'night-visions.jpg', '2017-09-10 15:17:09', '2017-09-10 15:17:09', 'show'),
	(162, 'Star Wars - The Legacy Revealed', 'Filmmakers, critics and even politicians discuss the social impact of the "Star Wars" films and the franchise\'s reliance in mythology and history.', NULL, 'star-wars-the-legacy-revealed.jpg', '2017-09-10 15:19:36', '2017-09-10 15:19:36', 'show'),
	(163, 'Star Wars Tech', 'This History Channel documentary gathers engineers and scientists to theorize on the possible real-world technologies behind the ships, weapons, droids, and gadgets of the Star Wars universe.', NULL, 'star-wars-tech.jpg', '2017-09-10 15:23:33', '2017-09-10 15:23:33', 'show'),
	(164, 'Tales from the Crypt', 'The iconic Crypt Keeper relates tales of horror in the vein of the gruesome E.C. comic books of the 1950s.', NULL, 'tales-from-the-crypt.jpg', '2017-09-10 15:28:01', '2017-09-10 15:28:01', 'show'),
	(165, 'The Ricky Gervais Show', 'Ricky Gervais and Stephen Merchant talk to Karl Pilkington about important things in life whilst Karl provides anything but intelligent answers. Comedy at its finest with wonderful animation.', NULL, 'the-ricky-gervais-show.jpg', '2017-09-10 15:30:35', '2017-09-10 15:30:35', 'show'),
	(166, 'The Spectacular Spider-Man', 'Young Peter Parker tries to balance life as a high-schooler with his superhero responsibilities, battling such foes as Doc Ock, Sandman, and The Green Goblin.', NULL, 'the-spectacular-spiderman.jpg', '2017-09-10 15:34:08', '2017-09-10 15:34:08', 'show'),
	(167, 'Todd and the Book of Pure Evil', 'A stoner metalhead named Todd Smith, his crush Jenny, his best friend Curtis, and the geeky Hannah, search their high school for a mayhem-causing Satanic spell book while being opposed by Atticus, their evil guidance counselor.', NULL, 'todd-and-the-book-of-pure-evil.jpg', '2017-09-10 15:36:02', '2017-09-10 15:36:02', 'show'),
	(168, 'True Blood', 'Telepathic waitress Sookie Stackhouse encounters a strange new supernatural world when she meets the mysterious Bill, a southern Louisiana gentleman and vampire.', NULL, 'true-blood.jpg', '2017-09-10 15:38:34', '2017-09-10 15:38:34', 'show'),
	(169, 'Garth Marenghi\'s Darkplace', 'This parody series is an unearthed 80s horror/drama, complete with poor production values, awful dialogue and hilarious violence. The series is set in a Hospital in Romford, which is situated over the gates of Hell.', NULL, 'garth-marenghis-darkplace.jpg', '2017-10-07 17:29:16', '2017-10-07 17:29:16', 'show'),
	(170, 'Ash vs Evil Dead', 'Having spent the last 30 years of his life avoiding responsibility and maturity, Ash must now face the resurrected threat of the Deadites. Accompanied by two co-workers, he must try to find a way to use the Necronomicon Ex-Mortis to put an end to the demonic forces and save the world from sure destruction.', NULL, 'ash-vs-evil-dead.jpg', '2017-11-04 14:35:14', '2017-11-04 14:35:14', 'show'),
	(171, 'Summer Heights High', 'The daily routines and dysfunctional relationships of several students and teachers at an Australian public school are captured in this mockumentary series.', NULL, 'summer-heights-high.jpg', '2017-11-05 09:10:21', '2017-11-05 09:10:21', 'show'),
	(172, 'Community', 'A disgraced lawyer with a fake law degree is forced to enroll in a cut-rate community college with an eclectic, and eccentric, student body.', NULL, 'community.jpg', '2017-11-05 12:16:13', '2017-11-05 12:16:13', 'show');
