INSERT INTO `episodes` (`media_id`, `season`, `episode_number`, `title`, `summary`, `created_at`, `updated_at`) VALUES
	 (152, 3, 1, 'Conquest of Cuteness', 'Finn and Jake come under attack in their home from a race of super-evil creatures which are too cute to be taken seriously.', '2017-09-27 00:32:54', '2018-12-27 09:51:12'),
	 (152, 3, 2, 'Morituri Te Salutamus', 'Finn and Jake end up in a haunted arena where they must fight ghost gladiators to escape.', '2017-09-27 00:38:02', '2018-12-27 09:51:12'),
	 (165, 1, 1, 'Space Monkey', 'Karl favors a "non-traditional," if impractical, approach to having kids. He also argues that people have "more than six senses"; intimates that cavemen and dinosaurs co-existed; and recalls a story about a pub tankard that killed anyone who touched it.', '2017-09-27 00:41:07', '2018-12-27 09:51:12'),
	 (152, 3, 3, 'Memory of a Memory', 'Finding their friend, Marceline the Vampire Queen, in a deep sleep, a mysterious stranger helps Finn and Jake by sending them into her dreams to awaken her.', '2017-09-28 00:03:03', '2018-12-27 09:51:12'),
	 (152, 3, 4, 'Hitman', 'The Ice King looks to hire a professional bully to beat up Finn and Jake, but inadvertently hires a deadly, unstoppable contract killer.', '2017-09-28 00:09:14', '2018-12-27 09:51:12'),
	 (152, 3, 5, 'Too Young', 'Finn is happy that Princess Bubblegum has regressed to the same age as him. But soon a challenger for the throne arrives to unseat the newly underage princess.', '2017-09-28 00:09:58', '2018-12-27 09:51:12'),
	 (152, 3, 6, 'The Monster', 'The king and queen of Lumpy Space ask Finn to find and return Lumpy Space Princess, who has been living in the woods and mistaken as a monster.', '2017-09-28 00:10:52', '2018-12-27 09:51:12'),
	 (152, 3, 7, 'Still', 'The Ice King uses a potion that paralyzes Finn and Jake, who become the lonely villain\'s unwilling best friends.', '2017-09-28 00:11:01', '2018-12-27 09:51:12'),
	 (152, 3, 8, 'Wizard Battle', 'The Ice King enters a battle of wizards from all over the Land of Ooo, to win a kiss from Princess Bubblegum--which Finn and Jake look to prevent.', '2017-09-28 00:11:24', '2018-12-27 09:51:12'),
	 (152, 3, 9, 'Fionna And Cake', 'In a world where all the characters are different genders, the adventurer Fionna gets advice from her cat-friend Cake on her date with Prince Gumball.', '2017-09-28 00:11:35', '2018-12-27 09:51:12'),
	 (152, 3, 10, 'What Was Missing', 'In order to open a magic door filled with stolen items, Finn and all his friends must perform in a band. But everyone\'s differing musical tastes and overall tensions make things difficult.', '2017-09-28 00:11:42', '2018-12-27 09:51:12'),
	 (152, 3, 11, 'Apple Thief', 'After Tree Trunks finds her apples have gone missing, Finn and Jake search the criminal underworld of the Candy Kingdom to recover them.', '2017-09-28 00:15:49', '2018-12-27 09:51:12'),
	 (152, 3, 12, 'The Creeps', 'Finn\'s masquerade birthday party turns into a deadly mystery.', '2017-09-28 00:16:09', '2018-12-27 09:51:12'),
	 (152, 3, 13, 'From Bad To Worse', 'The undead plague returns to the Candy Kingdom.', '2017-09-28 00:16:16', '2018-12-27 09:51:12'),
	 (152, 3, 14, 'Beautopia', 'Susan Strong returns and asks Finn and Jake to save her people from the Glubs. But Finn is still not sure if he can trust her after last time.', '2017-09-28 00:16:27', '2018-12-27 09:51:12'),
	 (152, 3, 15, 'No One Can Hear You', 'After trying to stop a deer that has been licking the Candy Kingdom people, Finn wakes up in a hospital to find everyone missing expect Jake who is acting very strange.', '2017-09-28 00:16:36', '2018-12-27 09:51:12'),
	 (152, 3, 16, 'Jake Vs. Me-mow', 'A tiny cat assassin tries to black mail Jake into killing someone, by hiding in his nose with some poison.', '2017-09-28 00:16:43', '2018-12-27 09:51:12'),
	 (152, 3, 17, 'Thank You', 'A fire-breathing wolf cub becomes lost in the snowy woods and becomes unlikely friends with a tall snow-creature.', '2017-09-28 00:17:15', '2018-12-27 09:51:12'),
	 (152, 3, 18, 'The New Frontier', 'Jake has a dream that seems to foretell his death but, to Finn\'s dismay, doesn\'t take it serious.', '2017-09-28 00:17:24', '2018-12-27 09:51:12'),
	 (152, 3, 19, 'Holly Jolly Secrets Part I', 'In Finn and Jake\'s holiday special, the heroes come across a video diary of the Ice King\'s and attempt to decipher its secrets.', '2017-09-28 00:17:31', '2018-12-27 09:51:12'),
	 (152, 3, 20, 'Holly Jolly Secrets Part II', 'In part two of the holiday special, The Ice King tries to get his video diary back from Finn and Jake.', '2017-09-28 00:17:40', '2018-12-27 09:51:12'),
	 (152, 3, 21, 'Marceline\'s Closet', 'Bored waiting for her, Finn and Jake sneak into Marceline\'s house, become trapped when she comes home, and witness her strange behavior when she\'s alone.', '2017-09-28 00:17:50', '2018-12-27 09:51:12'),
	 (152, 3, 22, 'Paper Pete', 'A secret war takes place in the library between tiny paper people and mold creatures, and Finn is brought into the middle of it all.', '2017-09-28 00:17:59', '2018-12-27 09:51:12'),
	 (152, 3, 23, 'Another Way', 'Finn journeys for a cyclops\'s magical tears to cure his injuries, but have trouble because of his stubborn inability to follow the advice of others.', '2017-09-28 00:18:06', '2018-12-27 09:51:12'),
	 (152, 3, 24, 'Ghost Princess', 'Finn and Jake try to help Ghost Princess by solving her murder.', '2017-09-28 00:18:15', '2018-12-27 09:51:12'),
	 (152, 3, 25, 'Dad\'s Dungeon', 'Finn and Jake discover a lost message from their dad which sends them to a mysterious and dangerous dungeon.', '2017-09-28 00:18:22', '2018-12-27 09:51:12'),
	 (152, 3, 26, 'Incendium', 'Trying to help Finn get over his hopeless feelings for Princess Bubblegum, Jake sets out to find a new princess for Finn to go out with.', '2017-09-28 00:18:30', '2018-12-27 09:51:12'),
	 (167, 1, 1, 'Todd the Metal God', 'Todd finds the Book of Pure Evil and uses it to become a better guitar player in an attempt to win his dream girl Jenny away from her douche-bag boyfriend. But along with making him a better guitar player, it also turns Todd evil.', '2017-09-28 00:19:46', '2018-12-27 09:51:12'),
	 (167, 1, 2, 'How to Make a Homunculus', 'Hannah uses the book to create a homunculus as a science project for the upcoming science fair, but the creature, which for some reason looks like Todd, breaks free. Todd, Curtis, Jenny and Hannah form a gang to stop the book.', '2017-09-28 00:20:03', '2018-12-27 09:51:12'),
	 (167, 1, 3, 'Rock \'n\' Roll Zombies Know Best', 'A goth girl named Marcy uses the book to summon her favorite rock stars from the dead, but the zombie rock stars eat her parents and she\'s forced to keep them in her basement and feeds them with guys that she lures over to her house.', '2017-09-28 00:20:13', '2018-12-27 09:51:12'),
	 (167, 1, 4, 'Gay Day', 'A bullied gay student at Crowley High uses the book to make every other guy at school gay, including Todd and Curtis, while making himself straight. Atticus attempts to glimpse Todd\'s penis to try and find the mark of the Pure Evil One.', '2017-09-28 00:20:31', '2018-12-27 09:51:12'),
	 (167, 1, 5, 'Monster Fat', 'The fattest girl in school uses the book to become skinny, but her leftover fat creates a monster that turns all the other girls in the school fat. Jenny becomes fat and Todd has to prove to her that his feelings for her aren\'t shallow.', '2017-09-28 00:20:40', '2018-12-27 09:51:12'),
	 (167, 1, 6, 'Invasion of the Stupid Snatchers', 'A slow-witted student uses the book to become the smartest kid in school, so the book creates a "stupid smoke" that makes everyone who breathes it stupid except for him, much to the amusement of stoners Curtis and Todd.', '2017-09-28 00:20:47', '2018-12-27 09:51:12'),
	 (167, 1, 7, 'Terrible Twin Turf Tussle', 'Jenny begins a lesbian relationship, causing the girl\'s jealous twin sister to use the book, creating clones armies of the sisters who battle it out in the school hallways. Hannah creates Todd a special suit so he can sense Pure Evil.', '2017-09-28 00:20:53', '2018-12-27 09:51:12'),
	 (167, 1, 8, 'Cockfight', 'A bully with a small penis is enraged when Todd sends a picture of it around the school. He uses the book to give himself a mammoth member, which goes out of control and starts turning anyone who looks at it to stone, starting with Curtis.', '2017-09-28 00:21:02', '2018-12-27 09:51:12'),
	 (167, 1, 9, 'Big Bad Baby', 'A girl uses the book to get pregnant, but the book accelerates the pregnancy, ending in a giant baby wreaking havoc in the halls of the school. Todd tries to reason with the baby and prove to Jenny that he could be a good father.', '2017-09-28 00:21:08', '2018-12-27 09:51:12'),
	 (167, 1, 10, 'The Ghost of Chet Sukowski', 'A basketball player uses the book and gets possessed by a ghost from the 1950\'s, causing him and Jenny to fall for each other. He challenges Todd to a suicidal drag race for Jenny\'s heart, for which the gang soups up Atticus\' van.', '2017-09-28 00:21:17', '2018-12-27 09:51:12'),
	 (167, 1, 11, 'The Phantom of Crowley High', 'A girl uses the book to become a better singer, but the spell backfires and her tongue falls out. She becomes the Phantom of Crowley High and Curtis falls for her. Meanwhile Atticus, Todd, and Jenny try to whip up a heavy metal musical.', '2017-09-28 00:21:25', '2018-12-27 09:51:12'),
	 (167, 1, 12, 'Checkmate', 'A genius chess player gets his hands on the book and forms a bizarre cult in the chessnasium, convinced that Todd is the Pure Evil One come to bring about the apocalypse. The cult tries to lure Todd into a trap to destroy him.', '2017-09-28 00:21:31', '2018-12-27 09:51:12'),
	 (167, 1, 13, 'A Farewell to Curtis\' Arm', 'Curtis uses the book to give himself a new giant evil arm. Todd must face the truth about his evil destiny as he fights Curtis, and Jenny learns the truth about her father. Atticus tries to regain his place among the Satanists.', '2017-09-28 00:21:39', '2018-12-27 09:51:12'),
	 (167, 2, 1, 'Redierment Home', 'The gang tries to rescue Jenny from the retirement home, but when Atticus\' disgruntled minion Bob uses the book to create a feast that makes everyone who eats it hungrier, they\'re forced to fight an army of seniors hungry for human flesh.', '2017-09-28 00:22:08', '2018-12-27 09:51:12'),
	 (167, 2, 2, 'The Student Body', 'A girl desperate to make friends uses the book, giving herself vine-like tendrils that brainwash and ensnare anyone she touches.', '2017-09-28 00:22:23', '2018-12-27 09:51:12'),
	 (167, 2, 3, 'Daddy Tissues', 'Jenny\'s father, now out of his coma, tries to join the gang, but when he\'s rejected, he uses the book to steal people\'s skin and disguises himself as various male students to infiltrate the gang.', '2017-09-28 00:22:31', '2018-12-27 09:51:12'),
	 (167, 2, 4, 'Simply the Beast', 'When cheerleaders start disappearing from the school hallways, leaving only their shredded uniforms behind, the gang becomes convinced that they\'ve been eaten by a mysterious creature called The Beast.', '2017-09-28 00:22:39', '2018-12-27 09:51:12'),
	 (167, 2, 5, 'Jungle Fever', 'An environmentalist fanatic becomes fed up with the littering going on at the school and uses the book to turn the school and everyone in it prehistoric.', '2017-09-28 00:22:47', '2018-12-27 09:51:12'),
	 (167, 2, 6, 'Fisting Fantasy', 'After being embarrassed in an online game by Todd and Curtis, a student uses the book to turn the school into a live-action RPG which the gang must battle through.', '2017-09-28 00:22:53', '2018-12-27 09:51:12'),
	 (167, 2, 7, 'See You Later Masturbator', 'Jimmy is fired for peeping on girls in the changing room and Todd vows to clear his name, but the gang find the real culprit difficult to identify - because he\'s invisible.', '2017-09-28 00:23:00', '2018-12-27 09:51:12'),
	 (167, 2, 8, 'Loser Generated Content', 'The A/V Club use the book to turn the gang\'s lives into a psycho thriller, and they cast Jenny as the victim and Todd as the killer.', '2017-09-28 00:23:08', '2018-12-27 09:51:12'),
	 (167, 2, 9, 'Deathday Cake', 'The gang make plans for a surprise party for Curtis\'s birthday, while a Puritan girl uses the book to make herself a giant birthday cake that eats students on their birthdays.', '2017-09-28 00:23:14', '2018-12-27 09:51:12'),
	 (167, 2, 10, '2 Girls, 1 Tongue', 'The Phantom of Crowley High returns and switches roles with Hannah to get Curtis back. The three dudes realize that Todd must lose his virginity to become the Pure Evil One. Atticus comes to terms with his past. And nobody can stop singing.', '2017-09-28 00:23:21', '2018-12-27 09:51:12'),
	 (167, 2, 11, 'BYOBOPE', 'Todd and Curtis try to lose their virginity at a house party, but things go south when Atticus shows up uninvited.', '2017-09-28 00:24:40', '2018-12-27 09:51:12'),
	 (167, 2, 12, 'The Toddyssey', 'When a paraplegic student uses the book to give himself fast legs, Todd jumps on his back and gets transported to the future, where Atticus has taken over as Satanic Overlord.', '2017-09-28 00:24:47', '2018-12-27 09:51:12'),
	 (167, 2, 13, 'Black Tie Showdown', 'Atticus takes the book and brainwashes the students of Crowley High to do his bidding, forcing a showdown with Todd at the semi-formal. Secrets are revealed, romances blossom and tragedy strikes, threatening to tear apart the gang for good.', '2017-09-28 00:24:55', '2018-12-27 09:51:12'),
	 (163, 1, 1, 'Star Wars Tech', '', '2017-09-28 00:28:28', '2018-12-27 09:51:12'),
	 (169, 1, 1, 'Once Upon a Beginning', 'Liz\'s first day on the job corresponds with Dagless\' friend staying at the hospital as a patient, which results in a portal to Hell opening beneath Dark Place.', '2017-10-07 21:34:02', '2018-12-27 09:51:12'),
	 (155, 1, 1, 'Batman Tech - The Dark Knight', '', '2017-09-28 00:30:46', '2018-12-27 09:51:12'),
	 (156, 1, 1, 'Batman Unmasked: The Psychology of the Dark Knight', '', '2017-09-28 00:31:38', '2018-12-27 09:51:12'),
	 (169, 1, 2, 'Hell Hath Fury', 'Someone, something, or some things have attacked the chef. So why are objects flying about of their own accord, assaulting innocent civilians and disrupting hospital procedure? Is it telekinesis, PMT, or a deadly mixture of the two? It\'s a deadly mixture of the two.', '2017-10-07 21:34:56', '2018-12-27 09:51:12'),
	 (162, 1, 1, 'Star Wars - The Legacy Revealed', '', '2017-09-28 00:32:25', '2018-12-27 09:51:12'),
	 (158, 1, 1, 'Parts 30 through 16', 'Collects moments 30 through 16.', '2017-09-28 00:34:04', '2018-12-27 09:51:12'),
