	 (157, 1, 5, 'Parts 13 through 1', 'Collects moments 13 through 1.', '2017-09-28 00:35:29', '2018-12-27 09:51:12'),
	 (166, 1, 1, 'Survival of the Fittest', 'Summer is over for Peter Parker and school\'s ready to start - both literally and in the real world of crime-fighting - as Spider-Man faces his first real challenge, the Enforcers, and his first real super-villain, Vulture.', '2017-10-01 15:41:26', '2018-12-27 09:51:12'),
	 (166, 1, 2, 'Interactions', 'Peter Parker attempts to tutor the popular Liz Allan while Spider-Man tries to stop Electro, who will stop at nothing to find a cure for the accident that made him who he is.', '2017-10-01 15:41:38', '2018-12-27 09:51:12'),
	 (166, 1, 3, 'Natural Selection', 'Peter Parker and Spider-Man both must learn to own their choices when decisions made by Dr. Curt Connors transform Pete\'s mentor into the Lizard.', '2017-10-01 15:41:50', '2018-12-27 09:51:12'),
	 (166, 1, 4, 'Market Forces', 'While Peter takes on the responsibility of helping Aunt May pay the bills, Montana (one of the Big Man\'s Enforcers) becomes the stunning Shocker to fulfill his responsibility: eliminating Spider-Man.', '2017-10-01 15:42:01', '2018-12-27 09:51:12'),
	 (166, 1, 5, 'Competition', 'According to Mr. Big\'s plan to divert Spiderman, common Flint Marko, whom he arrested repeatedly, is transformed into a monster, Sandman, who can escape any hold by transforming himself into sand. Meanwhile Peter risks compromising his cover and break Harry\'s heart by taking part in the school\'s American football try-outs, although the jocks aren\'t exactly welcoming nerds. Gwen just hopes Peter will take her to the formal dance.', '2017-10-01 15:42:10', '2018-12-27 09:51:12'),
	 (166, 1, 6, 'The Invisible Hand', 'Otto Octavius creates the Rhino in order to occupy Spider-Man. Meanwhile, Aunt May arranges to introduce Peter to Mary Jane Watson.', '2017-10-01 15:42:20', '2018-12-27 09:51:12'),
	 (166, 1, 7, 'Catalysts', 'Peter Parker and Mary Jane Watson go to the Midtown High Fall Formal. Meanwhile, the mysterious Green Goblin tries to force L. Thompson Lincoln to step down as NYC\'s Big Man of crime. Will Spider-Man be able to take on this new threat?', '2017-10-01 15:42:30', '2018-12-27 09:51:12'),
	 (166, 1, 8, 'Reaction', 'Peter Parker and Spider-Man learn that actions have consequences when nebbishy Dr. Otto Octavius becomes the megalomaniacal Doctor Octopus. The cause: Green Goblin; the effect: mayhem!', '2017-10-01 15:42:40', '2018-12-27 09:51:12'),
	 (166, 1, 9, 'The Uncertainty Principle', 'While Colonel John Jameson struggles to land his damaged space shuttle, Spider-Man struggles to defeat the Green Goblin, who also threatens Hammerhead and Tombstone.', '2017-10-01 15:42:50', '2018-12-27 09:51:12'),
	 (166, 1, 10, 'Persona', 'Dr. Curt Connors is examining organic matter from outer space. Peter is no longer welcome in the lab, but when Spiderman takes a peek he catches almost equally agile burglar Black Cat in the act. In fact he prevents her stealing the goo, but thinks she succeeded as in stealthily melted with his suit. He finds it increases his spider-strength. They team up and discover a jewel robbery in the making. Actually Dr. Curt Connors\'s place has been taken by Camelon, a master crook whose team was hired to steal the alien matter.', '2017-10-01 15:42:59', '2018-12-27 09:51:12'),
	 (166, 1, 11, 'Group Therapy', 'Peter was looking forward to a lazy Saturday, but Adrian Toomes manages to free from jail fellow criminal freaks Rhino, Electro, Sandman, Hammerhead and Doctor Octopus. At least the alien goo proves a very practical costume improvement. Yet it come at a price: amnesia, or the suit operates on its own. Meanwhile Pete is ostracized at school for \'selfishly\' photographing Spidey instead of preventing the theft.', '2017-10-01 15:43:09', '2018-12-27 09:51:12'),
	 (166, 1, 12, 'Intervention', 'Peter realizes he\'s completely neglecting his friends, influenced by the alien goo \'symbion\'. As it hates vibrations, he tries to get rid of it exposing it to church bells, but it pins him down and evokes memories of how it all started, the trauma of Uncle Ben\'s murder. However Ben\'s memory stays and encourages Peter to resist and wrestle loose. Now he brings the goo back to the lab and thinks he freezes it to death. Eddie is furious his rehabilitation is turned to hopeless. But the symbiont survived, transfers to Eddie and brings Peter\'s memories along.', '2017-10-01 15:43:45', '2018-12-27 09:51:12'),
	 (166, 1, 13, 'Nature vs. Nurture', 'After Peter turns down on offer to turn a blind eye on Mr. Lincoln\'s crimes, the black goo alien and Eddie eagerly accept, including their \'test\': defeat Spiderman! Now aunt May is recovering after a cardiac crisis, Peter feels even more guilty for neglecting his family and friends, who now forgive and support him. Only vindictive Eddie turns on his loved-ones.', '2017-10-01 15:43:53', '2018-12-27 09:51:12'),
	 (166, 2, 1, 'Blueprints', 'Peter feels miserable as he can\'t square his many ambitions and responsibilities, but will suddenly get professional breaks from both newspaper and lab. Spiderman faces a new challenge, Mysterio, who claims to fight the evil effects of technology and seems to perform magic with Latin spells. Spidey finds out neither is quite true, but not who is behind him.', '2017-10-01 15:44:21', '2018-12-27 09:51:12'),
	 (166, 2, 2, 'Destructive Testing', 'Peter feels great now Liz and Gwen appreciate him more as a tutor. Russian big game hunter, Sergei Kravinoff, who catches wild beasts with his bare hands and has a \'pet\' lion, Gulyadkin, fails to overpower Spiderman. At ESU lab, Miles Warren agrees to transform him with leonine mutagen, transforming him into lion-man Kraven.', '2017-10-01 15:44:28', '2018-12-27 09:51:12'),
	 (166, 2, 3, 'Reinforcement', 'Sandman and Rhino escape in the Christma season. Kraven frees Electro from Otto\'s lab. They all rejoin Mysterio\'s gang with Vulture, and are presented to the Master Planner, who wants them to inaugurate a heyday of crime by eliminating Spiderman. Gwen refuses to be Pete\'s \'second choice\' anymore. Spiderman fight the six under winter conditions and in the mall.', '2017-10-01 15:44:37', '2018-12-27 09:51:12'),
	 (166, 2, 4, 'Shear Strength', 'New Year\'s Eve. Dr. Octopus, who hid in Dr. Osborne\'s lab, finally pits his master plan in action. He hacks in by satellite to most computers in the city. He kidnaps Gwen to blackmail her dad, police captain George Stacy, into handing him the top-secret national network access codes. Spider-man must liberate her from the monsters\' layer before the captain hands Dr. Octopus virtual world control.', '2017-10-01 15:44:45', '2018-12-27 09:51:12'),
	 (166, 2, 5, 'First Steps', 'At his first school day, Peter feels it\'s too good to be true: he is with Flash\'s ex Liz; Harry is back, with Gwen and hopefully cured of his Green Goblin mutation. They double-date at Flash\'s birthday blast. After a museum alarm, Spiderman sees Eddie outside but finds and fights Sandman inside. Hammerhead has a dirtier job for him, attacking an oil tanker. Peter wonders if the symbiont is back.', '2017-10-01 15:44:53', '2018-12-27 09:51:12'),
	 (166, 2, 6, 'Growing Pains', 'Editor J. Jonah Jameson\'s son John, the astronaut, has been infected by space spores. They give him super-powers, so Jonah fit him a hero costume as Colonel Jupiter, who turns on Spiderman because of crimes committed by the black goo\'s creation Venom. Meanwhile Spiderman must handle Eddie, who transformed into that monster and threatens Peter to keep him silent, while Harry finds glory in school theatre. Police captain George Stacy believes in Spidey\'s innocence. The spores prove addictive and Venom betrays Peter\'s secret.', '2017-10-01 15:45:01', '2018-12-27 09:51:12'),
	 (166, 2, 7, 'Identity Crisis', 'Editor J. Jonah Jameson\'s analysis who might be Spiderman indicates Peter, so he sends reporters to question everybody about his whereabouts. Eddie returns to the lab and steals a gene cleanser to rob Spidey of his powers and deals with helpless Peter and his loved ones. Jealous of the media attention, Flash poses in a Spiderman suit. Crooks see his crutches and think Spiderman is at his weakest. Captain Stacy holds a seminar on identity risks.', '2017-10-01 15:45:09', '2018-12-27 09:51:12'),
	 (166, 2, 8, 'Accomplices', 'Peter volunteers as photographer for an old Pullitzer winner discarded by Jonah. The discover the underworld\'s recently release former kingpin Sable Manfredi is auctioning genetic technology to create monsters at will. As Spiderman, he tries to keep it out of the bid-winner\'s hands, but soon finds that also means taking on sore losers.', '2017-10-01 15:45:17', '2018-12-27 09:51:12'),
	 (166, 2, 9, 'Probable Cause', 'The kids grumbled when paired by lot-drawing at a project riding along in cop patrol cars. Petey has to rush between his identities to fight the crime world\'s new Enforcers, supplied by Notman Osborne\'s secret new scientist. Meanwhile Flash turns in the Mustangs for winning the cup while Harry was doped.', '2017-10-01 15:45:26', '2018-12-27 09:51:12'),
	 (166, 2, 10, 'Gangland', 'On Valentine\'s day, the youth has gathered for a glamorous dinner in LC\'s dad\'s restaurant. The New York crime high life gathers in the Metropolitan Opera. It\'s unclear who invited the others, but achieves his (Hammerhead\'s) plan: they start fighting each-other. Peter must leave the table fun of kicking Flash each time he puts his jock foot in his dumb mouth, to \'cover breaking news\', an excuse Jonah craves just to leave. As Spiderman, Pete tries to stop the fighting fiends from demolishing the Met.', '2017-10-01 15:45:33', '2018-12-27 09:51:12'),
	 (166, 2, 11, 'Subtext', 'Pete\'s team mate Marcus Allen is addicted to horse races. His bookie, one of the Green Goblin\'s crime barons, offers him one out of gambling debts: a single injection. Alas, Dr. Curt Connors\'s potion installs an \'armor\' of fire, creating the \'Molten Man\', whose glow is controlled by a device the Goblin gets. Spiderman must counter, yet save the uncontrollable arsonist.', '2017-10-01 15:45:41', '2018-12-27 09:51:12'),
	 (166, 2, 12, 'Opening Night', 'Editor Jonah roots against Spiderman when he tests if a new Oscorp top-security penitentiary design is escape-proof. Not only does he succeed in tricking the guards, Green Goblin-orchestrated sabotage releases the freak-thugs, so they can chase Spidey while he\'s trapped inside.', '2017-10-01 15:45:48', '2018-12-27 09:51:12'),
	 (166, 2, 13, 'Final Curtain', 'Spiderman has his hands full with unusual crime activity coordinated by the Green Goblin, now his crime lord competitors have been eliminated. As Peter he worries with Norman Osborn about Harry, who finally confesses to them he fears to be transformed by the Globuline he got addicted too. After establishing some crimes chronologically can\'t be Harry\'s doing, they discover the complex truth, involving Globuline-creator Donald Menken, who has fled Oscorp.', '2017-10-01 15:45:55', '2018-12-27 09:51:12'),
	 (168, 1, 1, 'Strange Love', 'Two years after vampires have "come out of the coffin", the life of 25-year-old waitress Sookie Stackhouse is changed when 173-year-old Bill Compton walks into Merlotte\'s Bar in Bon Temps, Louisiana. Meanwhile, Sookie\'s friend Tara comes to work at Merlotte\'s while Sookie\'s tomcatting brother Jason finds himself on the wrong side of the law.', '2017-10-01 15:47:44', '2018-12-27 09:51:12'),
	 (168, 1, 2, 'The First Taste', 'After saving Sookie from the Rattray\'s revenge, Bill uses his vampire blood to heal Sookie and it leaves her with some strange side effects. In return, Sookie invites him to her house for a get-to-know-you gathering with Jason, Tara and Gran. Jason is released from custody, having only been a person of interest in the murder investigation of Maudette. He continues his amorous ways with Dawn, discovering her to also have had encounters with a vampire. Tara expresses her interest in Jason, while the Rattrays are killed by an apparent freak tornado. Later, out looking for Bill, Sookie comes across strange vampires.', '2017-10-01 15:50:07', '2018-12-27 09:51:12'),
	 (168, 1, 3, 'Mine', 'Bill must suddenly lay claim to Sookie in order to protect her from a cadre of his vampire acquaintances. At Merlotte\'s, Sam and Tara seek refuge from their respective problems, and Jason asks Lafayette for medicinal help. Dawn is found dead in her bed after an intimate encounter and falling-out with Jason.', '2017-10-01 15:50:27', '2018-12-27 09:51:12'),
	 (168, 1, 4, 'Escape from Dragon House', 'When another Bon Temps resident is found murdered under suspicious circumstances, Jason is once again taken into custody and it is up to Sookie to uncover the identity of the real killer and clear her brother\'s name. Asking for his help Bill takes Sookie to the vampire bar Fangtasia, where she is introduced to Eric, a thousand-year-old Viking vampire and Bill\'s superior.', '2017-10-01 15:53:54', '2018-12-27 09:51:12'),
	 (168, 1, 5, 'Sparks Fly Out', 'Spurned by an exasperated Sookie, Bill ends up winning over Adele\'s church audience with his vivid recollections from the Civil War, though Andy and Bud remain suspicious. Sam tries to make the most of his fading opportunity with Sookie, though she\'s clearly not ready to commit. Ignoring Tara\'s rebuff, Lafayette convinces Jason to give vampire blood, aka "V juice," another shot. Alone at home, Bill remembers the painful wartime incident that parted him from his beloved family and changed his fate forever.', '2017-10-01 15:54:18', '2018-12-27 09:51:12'),
	 (168, 1, 6, 'Cold Ground', 'Numbed by tragedy, Sookie looks for refuge from the cacophony of her friends\' and neighbors\' inner voices. After lashing out at his sister and decking Andy, Jason wrestles with withdrawal symptoms from his V juice habit. Tara resists the overtures of her alcoholic mother Lettie Mae, who\'s trying to rid herself of a demon and needs her daughter\'s help (and money). Sam and Tara make a connection in their mutual search for "something real."', '2017-10-01 15:54:42', '2018-12-27 09:51:12'),
	 (168, 1, 7, 'Burning House of Love', 'Sookie\'s painful childhood revelation about her Uncle Bartlett spurs Bill into vengeful action. Despite her skepticism, Tara agrees to pay for an exorcism to purge Lettie Mae of a demon. In search of V juice, Jason travels to Fangtasia, where he bonds with an adventurous young woman named Amy. A trio of rednecks decide to exact vigilante justice on a pack of vampires who crashed Merlotte\'s in search of their wayward mate Bill.', '2017-10-01 15:54:56', '2018-12-27 09:51:12'),
	 (168, 1, 8, 'The Fourth Man in the Fire', 'Sookie tries to hold herself together in the wake of another possible tragedy. Tara is amazed by Lettie Mae\'s turnaround, and considers similar therapy for herself after lashing out at Sookie and Sam. Jason\'s new squeeze Amy charms the crowd at Merlotte\'s, but shows a darker side to Jason when their V juice well runs dry. RenÃ© pops the question to Arlene while Sookie is baby-sitting her kids. Later, at Bill\'s request on behalf of Eric, Sookie agrees to use her gifts to help Eric, a powerful vampire sheriff, root out a thief at Fangtasia.', '2017-10-01 15:55:11', '2018-12-27 09:51:12'),
	 (168, 1, 9, 'Plaisir d\'amour', 'Bill breaks a vampire taboo in saving Sookie from vampire Longshadow\'s attack, and must pay a steep price as a result. Jason and Amy break their own taboo by kidnapping a vampire named Eddie in order to harvest his blood. With Lettie Mae apparently cured, a skeptical Tara consults with Miss Jeanette about exorcising her own inner demon. Sookie returns home to yet another horrific tragedy, prompting Bill to enlist an unlikely bodyguard - Sam - to protect her while he\'s away.', '2017-10-01 15:55:29', '2018-12-27 09:51:12'),
	 (168, 1, 10, 'I Don\'t Wanna Know', 'Caught in a compromising position, Sam shares a secret with an incredulous Sookie. Thinking she\'s been purged of her demon, Tara celebrates with Lettie Mae - but goes off the deep end when she uncovers Miss Jeanette\'s true intentions. Sookie has a disturbing revelation during Arlene and RenÃ©\'s engagement party at Merlotte\'s. Jason and Amy debate what to do with Eddie. Tara speeds into a bizarre roadside encounter that lands her in jail. At a vampire tribunal to decide his fate, Bill faces a harsh penalty for his offense, but the Magister decides on a more creative sentence involving a human teen named Jessica.', '2017-10-01 15:56:09', '2018-12-27 09:51:12'),
	 (168, 1, 11, 'To Love Is to Bury', 'Bill fulfills the conditions of the tribunal\'s sentence, although he and Eric find that Jessica doesn\'t quite turn (out) as expected. Trying to solve the mystery behind her most recent vision, Sookie heads to a pie shop with Sam and later puts the squeeze on a philandering police officer to get info on a murder suspect. Jason helps clean up Amy\'s bloody mess, worrying about their future, but is unable to break away. Tara\'s anger over Lettie Mae\'s refusal to bail her out of jail is tempered when Maryann Forrester, a wealthy "social worker," comes to her rescue. Disgusted by the hypocrisy of a vamp-bashing state senator, Lafayette decides to pay him a warning visit on the campaign trail. In Bill\'s absence, a vulnerable Sookie finds comfort in Sam. A distraught, self-doubting Jason finds himself in hot water with Sheriff Bud and Detective Andy, again.', '2017-10-01 15:56:34', '2018-12-27 09:51:12'),
	 (168, 1, 12, 'You\'ll Be the Death of Me', 'Sookie finds a link to the string of killings in Bon Temps - and is soon in the murderer\'s cross hairs again. Tara decides to make the most of her second chance with Maryann. Jason finds a new calling after anti-vampire zealot Orry visits him in jail. Bill tempts fate during his latest attempt to save Sookie. Sam is perturbed by a surprise encounter with an old acquaintance. Lafayette finds himself in the wrong place at the wrong time.', '2017-10-01 15:56:50', '2018-12-27 09:51:13'),
	 (169, 1, 3, 'Skipper the Eyechild', 'When a giant eyeball rapes and impregnates a male patient (don\'t ask how that\'s possible, because it won\'t be explained), Dagless comes to love the resulting offspring, a baby eyeball, as a surrogate for Skipper, his deceased half-grasshopper son.', '2017-10-07 21:35:21', '2018-12-27 09:51:13'),
	 (169, 1, 4, 'The Apes of Wrath', 'Contaminated water turns the staff of Dark Place into intelligent apes.', '2017-10-07 21:35:46', '2018-12-27 09:51:13'),
	 (169, 1, 5, 'Scotch Mist', 'A strange mist descends on Dark Place, within which the murderous spirits on Scottish highlanders prey upon the hospital\'s staff.', '2017-10-07 21:36:02', '2018-12-27 09:51:13'),
	 (169, 1, 6, 'The Creeping Moss from the Shores of Shuggoth', 'Sanchez falls in love with a beautiful female patient who is slowly turning into cosmic broccoli.', '2017-10-07 21:36:15', '2018-12-27 09:51:13'),
