	 (153, 1, 0, 'Pilot', '', '2017-10-08 12:45:57', '2018-12-27 09:51:13'),
	 (153, 1, 1, 'China', 'Karl Pilkington embarks on his epic journey, with his first stop being a trip to China.', '2017-10-08 12:47:19', '2018-12-27 09:51:13'),
	 (153, 1, 2, 'India', 'Karl Pilkington\'s second trip takes him to India to visit the Taj Mahal.', '2017-10-08 12:47:37', '2018-12-27 09:51:13'),
	 (153, 1, 3, 'Jordan', 'This time, Karl Pikington\'s voyage takes him to Petra in Jordan by way of Israel to see what he thinks of the "rose-red city half as old as time".', '2017-10-08 12:48:06', '2018-12-27 09:51:13'),
	 (153, 1, 4, 'Mexico', 'This week, Karl Pilkington travels to Mexico where he will visit Chichen Itza, but not without first trying his luck at wrestling, being a cowboy and hunting for a Mexican jumping bean.', '2017-10-08 12:48:22', '2018-12-27 09:51:13'),
	 (153, 1, 5, 'Egypt', 'This time Karl faces the Pyramids as he heads to Egypt to once again share his unique insight on yet another Wonder.', '2017-10-08 12:48:35', '2018-12-27 09:51:13'),
	 (153, 1, 6, 'Brazil', 'Join Karl Pilkington as he travels to Rio de Janeiro to visit Christ the Redeemer. On his way he will have a go at waxing and Brazil\'s famous beaches.', '2017-10-08 12:48:51', '2018-12-27 09:51:13'),
	 (153, 1, 7, 'Peru', 'Karl Pilkington goes visit his final Wonder: Machu Picchu in Peru. En route, he will stay overnight in the Amazon jungle and meet a tribe of reformed cannibals.', '2017-10-08 12:49:05', '2018-12-27 09:51:13'),
	 (153, 1, 8, 'Karl Comes Home', 'Karl Pilkington meets with Ricky Gervais and Steve Merchant to discuss his travels.', '2017-10-08 12:49:21', '2018-12-27 09:51:13'),
	 (153, 2, 1, 'Desert Island', 'The first episode from season 2 sees Karl spending a night on a desert island where he meets a tribe who worship Prince Philip. He later attempts bungee jump.', '2017-10-08 12:49:56', '2018-12-27 09:51:13'),
	 (153, 2, 2, 'Trans-Siberian Express', 'Karl, expecting a luxurious trip to Russia on the Trans-Siberian Express is unsurprised to find himself in third class. Arriving in China, he later tries his hand at Mongolian wrestling and visits a village of dwarves.', '2017-10-08 12:50:05', '2018-12-27 09:51:13'),
	 (153, 2, 3, 'Swim with Dolphins', 'Karl reluctantly travels to Australia to swim with dolphins, which actually turn out to be great white sharks. He also partakes in blindfolded kickboxing and comes face to face with hundreds of snakes.', '2017-10-08 12:50:51', '2018-12-27 09:51:13'),
	 (153, 2, 4, 'Whale Watching', 'Karl is sent to Alaska to do some whale watching where he promptly gets seasick.', '2017-10-08 12:51:09', '2018-12-27 09:51:13'),
	 (153, 2, 5, 'Meet a Gorilla', 'Ricky Gervais and Stephen Merchant send Karl to Uganda to meet and spend time with highly endangered Mountain Gorillas. Along the way Karl prepares a feast for an African tribal king, encounters a rhinoceros and comes across a hippo that lives in a house all before having to trek 10 hours in the jungle.', '2017-10-08 12:51:46', '2018-12-27 09:51:13'),
	 (160, 10, 4, 'Werewolf', 'A guy turns people into werewolves for his own sick pleasure while Mike turns into a were-Crow.', '2017-10-08 13:11:13', '2018-12-27 09:51:13'),
	 (153, 2, 6, 'Route 66', 'Karl\'s next bucket list selection takes him to Route 66 in the United States. During his journey he participates in a musical, attends a cuddle party, mines for gold, lives with an Amish family and must ride on the top of an airplane.', '2017-10-08 13:11:34', '2018-12-27 09:51:13'),
	 (153, 2, 7, 'Climb Mount Fuji', 'On his final journey, Karl prepares for a grueling 15 hour trek up Mount Fuji.', '2017-10-08 13:11:49', '2018-12-27 09:51:13'),
	 (153, 2, 8, 'Karl Comes Home', 'Karl finally arrives home where Ricky and Stephen have a few surprises lined up for him.', '2017-10-08 13:12:25', '2018-12-27 09:51:13'),
	 (153, 3, 1, 'The Short Way Around: Venice', 'Karl Pilkington\'s got company this time around: film and TV star Warwick Davis. Following in the footsteps of Marco Polo, the odd couple start off in Venice.', '2017-10-08 13:12:55', '2018-12-27 09:51:13'),
	 (153, 3, 2, 'The Short Way Around: India', 'Karl and Warwick\'s journey continues via India. Laughing yoga and parts in a Bollywood movie are trumped when Karl experiences his first holiday highlight.', '2017-10-08 13:13:54', '2018-12-27 09:51:13'),
	 (153, 3, 3, 'The Short Way Around: China', 'It\'s the final leg of the journey as Karl and Warwick prepare to make their way to China. A surprise also awaits to ensure this third season finishes on a high.', '2017-10-08 13:14:13', '2018-12-27 09:51:13'),
	 (154, 1, 1, 'The Tale of the Phantom Cab', '', '2017-10-11 23:25:41', '2018-12-27 09:51:13'),
	 (160, 11, 12, 'Squirm', 'Angry worms munch on a town and a doughy guy learns the value of springs by a demonic little sprite.', '2017-10-14 00:14:46', '2018-12-27 09:51:13'),
	 (160, 10, 7, 'Hobgoblins', 'Some not-too-bright teens pursue some evil little creatures who have escaped from confinement.', '2017-10-14 00:23:29', '2018-12-27 09:51:13'),
